no_calls_notify_time_period.description:
Configuration for no calls notification time periods, timeframes, and exception numbers
Example:
```json
{
    "time_zone": "America/New_York",
    "time_periods": [
        {
            "start_time": "09:00",
            "end_time": "17:00",
            "time_frame": 30
        },
        {
            "start_time": "18:00",
            "end_time": "23:59",
            "time_frame": 60
        }
    ],
    "exception_numbers": ["+15551234567", "+14155552671"]
}
```
Note: Calls with customer_number in exception_numbers list will be ignored when checking for no calls alert.

